import React from "react";
import { useNavigate } from "react-router-dom";
import { Header, Footer } from "../components/mollecules";
import { Forms } from "../components/organismes";
import { useAuth } from "../context";

function Profile() {
  const { profile, isLoggedIn, signOut } = useAuth();
  const navigate = useNavigate(); // Utilisez useNavigate pour gérer la navigation

  if (!isLoggedIn) {
    navigate("/connexion"); // Redirigez vers la page de connexion
    return null; // Rendre null pendant la redirection
  }

  return (
    <div>
      <div className="min-h-screen flex flex-col justify-between">
        <div>
          <Header.LaptopHeader />
          <div>le profil</div>
        </div>
        <div>
          <Footer.laptopFooter />
        </div>
      </div>
    </div>
  );
}

export default Profile;
